    sp.find_by_properties = function(arr, props){
        var filtered_arr = [];
        for(var i = 0; i < arr.length; i+=1) {
            var seeked = arr[i];
            var good = true;
            for(var p in props){
                if(props[p] != seeked[p]){
                    good = false;
                }
            }
            if(good) filtered_arr.push(seeked);
        }
        return filtered_arr;
    };

